import java.util.*;
import java.io.*;

public class Main {
    public static void main(String[] args) throws IOException {
        BufferedReader br = new BufferedReader(new InputStreamReader(System.in));
        int t = Integer.parseInt(br.readLine());
        while (t-- > 0) {
            int n = Integer.parseInt(br.readLine());
            List<int[]> stars = new ArrayList<>();
            for (int i = 0; i < n; i++) {
                String[] line = br.readLine().split(" ");
                stars.add(new int[]{Integer.parseInt(line[0]), Integer.parseInt(line[1]), Integer.parseInt(line[2])});
            }
            int m = Integer.parseInt(br.readLine());
            List<int[]> telescopes = new ArrayList<>();
            for (int i = 0; i < m; i++) {
                String[] line = br.readLine().split(" ");
                telescopes.add(new int[]{Integer.parseInt(line[0]), Integer.parseInt(line[1]), Integer.parseInt(line[2]), Double.parseDouble(line[3])});
            }
            Set<String> seen = new HashSet<>();
            for (int i = 0; i < n; i++) {
                for (int j = 0; j < m; j++) {
                    double theta = Math.acos((stars.get(i)[0] * telescopes.get(j)[0] + stars.get(i)[1] * telescopes.get(j)[1] + stars.get(i)[2] * telescopes.get(j)[2]) / (Math.sqrt(stars.get(i)[0] * stars.get(i)[0] + stars.get(i)[1] * stars.get(i)[1] + stars.get(i)[2] * stars.get(i)[2]) * Math.sqrt(telescopes.get(j)[0] * telescopes.get(j)[0] + telescopes.get(j)[1] * telescopes.get(j)[1] + telescopes.get(j)[2] * telescopes.get(j)[2])));
                    if (theta < telescopes.get(j)[3]) {
                        String key = stars.get(i)[0] + "," + stars.get(i)[1] + "," + stars.get(i)[2] + "," + j;
                        seen.add(key);
                    }
                }
            }
            System.out.println(seen.size());
        }
    }
}
